import React, { useEffect, useState } from 'react';
import './Header.scss';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Link } from 'react-router-dom'; // Import Link

interface StoreView {
    store_code: string;
    store_name: string;
    base_url: string;
    base_link_url: string;
    base_static_url: string;
    base_media_url: string;
    locale: string;
}

const Header = () => {
    const [storeViews, setStoreViews] = useState<StoreView[]>([]);
    const [currentStoreView, setCurrentStoreView] = useState<string>('');
    const [fetchError, setFetchError] = useState<string>('');

    useEffect(() => {
        const fetchStoreViews = async () => {
            const query = `
                {
                    availableStores {
                        store_code
                        store_name
                        base_url
                        base_link_url
                        base_static_url
                        base_media_url
                        locale
                    }
                }
            `;

            try {
                const response = await fetch('http://mint.local/graphql', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({ query }),
                });

                if (!response.ok) {
                    const responseText = await response.text();
                    throw new Error(`Error fetching store views: ${responseText}`);
                }

                const data = await response.json();
                const availableStores = data.data.availableStores;

                const filteredStoreViews: StoreView[] = availableStores.filter((storeView: StoreView) => storeView.store_name !== 'Admin'); // Exclude "Admin"

                setStoreViews(filteredStoreViews);

                const englishStoreView = filteredStoreViews.find(storeView => storeView.store_name === 'English');
                if (englishStoreView) {
                    setCurrentStoreView(englishStoreView.store_code);
                } else if (filteredStoreViews.length > 0) {
                    setCurrentStoreView(filteredStoreViews[0].store_code);
                }

            } catch (error: unknown) {
                if (error instanceof Error) {
                    console.error('Error fetching store views:', error);
                    setFetchError(error.message);
                } else {
                    console.error('Unexpected error:', error);
                    setFetchError('An unknown error occurred');
                }
            }
        };

        fetchStoreViews();
    }, []);

    const handleStoreViewChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
        setCurrentStoreView(event.target.value);
    };

    return (
        <header className="header">
            <div className="header-top">
                <div className="contact-info">
                    <span className="phone"><i className="fas fa-phone"></i> +(48) 123-456-789</span>
                    <span className="email"><i className="fas fa-envelope"></i> mint@contact.com</span>
                </div>

                <div className="right-actions">
                    <div className="storeview-select">
                        {fetchError ? (
                            <p className="error">{fetchError}</p>
                        ) : (
                            <select value={currentStoreView} onChange={handleStoreViewChange}>
                                {storeViews.length > 0 ? (
                                    storeViews.map((storeView) => (
                                        <option key={storeView.store_code} value={storeView.store_code}>
                                            {storeView.store_name}
                                        </option>
                                    ))
                                ) : (
                                    <option>Loading store views...</option>
                                )}
                            </select>
                        )}
                    </div>

                    <div className="user-actions">
                        <Link to="/login"><i className="fas fa-user"></i></Link>
                        <Link to="/cart"><i className="fas fa-shopping-cart"></i></Link>
                    </div>
                </div>
            </div>

            <div className="header-bottom">
                <div className="logo">
                    <img src="/assets/images/logo.png" alt="Logo" />
                </div>
                <nav className="navigation">
                    <ul>
                        <li><Link to="/">Home</Link></li>
                        <li><Link to="/gold">Gold</Link></li>
                        <li><Link to="/silver">Silver</Link></li>
                        <li><Link to="/contact">Contact</Link></li>
                    </ul>
                </nav>
                <div className="search">
                    <input type="text" placeholder="I am looking for..." />
                    <button type="submit"><i className="fas fa-search"></i></button>
                </div>
            </div>
        </header>
    );
};

export default Header;
